import React from "react";

const PreventMeasures = () => {
    return (
        <div className="mt-5 text-center">
            <h2>Preventive Measures</h2>
            <p>Information about preventing cattle diseases will go here.</p>
        </div>
    );
};

export default PreventMeasures;
